function verticalRow(gridSize){var r=new Uint8Array(gridSize*gridSize),i=Math.floor((gridSize-1)/2),e=Math.ceil((gridSize-1)/2);for(let n=0;n<r.length;n++){var t=n%gridSize;r[n]=t===i||t===e?1:0}return r}function random(gridSize){var r=new Uint8Array(gridSize*gridSize);for(let i=0;i<r.length;i++)Math.random()<.5&&(r[i]=1);return r}export{verticalRow,random};